import React from 'react';
import aboutImage from '../img/about.png'; // Import gambar about
import javaLogo from '../img/Logo/Java.png'; // Import logo tools
import pythonLogo from '../img/Logo/Python.png';
import mysqlLogo from '../img/Logo/MySQL.png';
import htmlLogo from '../img/Logo/HTML.png';
import cssLogo from '../img/Logo/CSS.png';
import jsLogo from '../img/Logo/JavaScript.png';
import kotlinLogo from '../img/Logo/Kotlin.png';
import phpLogo from '../img/Logo/PHP.png';
import reactLogo from '../img/Logo/React.png';
import composeLogo from '../img/Logo/Jetpack compose.png';
import figmaLogo from '../img/Logo/Figma.png';
import excelLogo from '../img/Logo/Excel.png';
import gitLogo from '../img/Logo/Git.png';
import notionLogo from '../img/Logo/Notion.png';
import lookerLogo from '../img/Logo/Looker Studio.png';
import tailwindLogo from '../img/Logo/Tailwind.png';

import '../stylesheet.css';
import '../responsive.css';
import '../index.css';

const About = () => {
  return (
    <div className="about" id="about">
      <div className="about-text">
        <h1><span>About</span> Hanif</h1>
        <p>Hello, my name is Hanif Darmawan and you can call me Hanif. I am an informatics engineering student at Brawijaya University. I have taken interest in Front-End Development and also Web Developer.</p>
        <div className="button-cv">
          <a href="https://drive.google.com/file/d/1fYSNqkTcMEXvJPefpP1bNLJ6dZR4VXub/view?usp=share_link" target="_blank" rel="noreferrer">View CV</a>
        </div>
      </div>
      <div className="about-img">
        <img className="about-image" src={aboutImage} alt="About Hanif" />
      </div>

    </div>
  );
};

export default About;
